
import Long from 'long'

/**
 * Return code: v1区間だしテーブルもないので無理
 */
export const MURI = -666
/**
 * Return code: 移動時間が分解能より少ない
 */
export const TOO_CLOSE = -667

/**
 * IDテーブル分解能 sec
 */
const tblDivSec = 3600

/**
 * 指定日付から指定時間移動したステータスIDを算出する
 * @param {Date} date 移動元のDate
 * @param {number} add 移動する時間(ミリ秒)
 * @param {boolean} v1 v1のIDとして計算するか
 * @param {string} host インスタンスホスト名
 */
export function getShiftedId (date, add, v1, host){
  const tsSrc = date.getTime()        // 移動元UNIXミリ秒
  const tsDst = new Date(tsSrc + add) // 移動後UNIXミリ秒

  if (!v1) {
    // v2以降の場合 << 16
    const longDst = Long.fromNumber(tsDst).shiftLeft(16)
    return longDst.toString() // allways return as string
  }
  else {
    // v1の場合テーブル探索を試みる

    // 分解能チェック
    if (tblDivSec*1000 > Math.abs(add)) {
      return TOO_CLOSE
    }

    if (host && t1[host]) { // テーブルある？
      const tbl = t1[host]

      // 移動後UNIXTime tblDivSec単位で未来方向に切り上げ
      let unixDst = tsDst / 1000
      unixDst = unixDst + (tblDivSec / 2)
      
      let id
      for (let i = 0; i < tbl.length; i++){
        id = tbl[i][1]
        if (unixDst > tbl[i][0]) break
      }
      return id + 5 // わかりづらいので正時を超えた分を余分に表示する
    }
    else {
      // テーブルない
      return MURI
    }
  }
}

